trailingComments.value:
*
	 * Creates a TimeSlot instance of the same periodicity than the current once, but which follows it
	 * 
	 * @return {TimeSlot}
	 * @example
	 * var ts = new TimeSlot('2010');
	 * ts.next().value // 2011
	 *
	 * var ts2 = new TimeSlot('2010-W52-sat');
	 * ts.next().value // 2011-W01-sat

